CREATE TABLE IF NOT EXISTS GLOBALENERGYMIX(
   Id SERIAL PRIMARY KEY,
   Biofuel_TWh NUMERIC(6,2) NOT NULL,
   Carbon_intensity NUMERIC(7,3) NOT NULL,
   Coal_TWh NUMERIC(7,2) NOT NULL,
   Country_name VARCHAR(32) NOT NULL,
   Fossil_TWh NUMERIC(7,2) NOT NULL,
   Gas_TWh NUMERIC(7,2) NOT NULL,
   Hydroelectricity_TWh NUMERIC(6,2) NOT NULL,
   Iso_code VARCHAR(3) NOT NULL,
   Low_carbon_TWh NUMERIC(7,2) NOT NULL,
   Nuclear_TWh NUMERIC(6,2) NOT NULL,
   Oil_TWh NUMERIC(6,2) NOT NULL,
   Other_renewable_TWh NUMERIC(7,3) NOT NULL,
   Other_renewable_exc_biofuel_TWh NUMERIC(5,2) NOT NULL,
   Per_capita_Wh NUMERIC(9,3) NOT NULL,
   Renewables_TWh NUMERIC(7,2) NOT NULL,
   Solar_TWh NUMERIC(6,2) NOT NULL,
   Total_TWh VARCHAR(19) NOT NULL,
   Wind_TWh NUMERIC(6,2) NOT NULL,
   Data_Year INTEGER NOT NULL
);

